        <Header />
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/Newsletters" element={<Newsletters />} />
          <Route path="/About" element={<About />} />
          <Route path="/Expectations" element={<Expectations />} />

        </Routes>
      </div>
    </Router>
  );
}

